// src/components/TariffMonitor.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function TariffMonitor() {
  const [tariffs, setTariffs] = useState([]);

  useEffect(() => {
    const fetchTariffs = async () => {
      const response = await axios.get('http://localhost:5000/api/tariffs');
      setTariffs(response.data);
    };

    fetchTariffs();
  }, []);

  return (
    <div>
      <h3>Real-Time Tariff Monitoring</h3>
      {tariffs.map((tariff) => (
        <div key={tariff.id}>
          <p>Time: {tariff.time} - Price: ${tariff.price}</p>
        </div>
      ))}
    </div>
  );
}

export default TariffMonitor;
